"""
    Given a string S, you are allowed to convert it to a palindrome by adding characters in front of it. Find and return
    the shortest palindrome you can find by performing this transformation.

    For example:

    Given "aacecaaa", return "aaacecaaa".

    Given "abcd", return "dcbabcd".
"""
def shortest_palindrome(s):
    n = len(s)

    r = s[::-1]
    left = s[1:][::-1]
    mid = len(s) / 2
    while mid >= 0:
        if r[-mid:] == s[mid + 1: 2 * mid + 1]:
            left = s[2 * mid + 1:][::-1]
            break
        if r[-mid:] == s[mid : 2 * mid]:
            left = s[2 * mid:][::-1]
            break
        mid -= 1

    return left + s


# We can construct the following string and run KMP algorithm on it: (s) + (some symbol not present in s) + (reversed string)
#
# After running KMP on that string as result we get a vector p with values of a prefix function for each character (for
# definition of a prefix function see KMP algorithm description). We are only interested in the last value because it shows
# us the largest suffix of the reversed string that matches the prefix of the original string. So basically all we left to
# do is to add the first k characters of the reversed string to the original string, where k is a difference between original
# string size and the prefix function for the last character of a constructed string.
def shortest_palindrome3(s):
    rev = s[::-1]
    l = s + '#' + rev

    p = [0] * len(l)
    for i in range(1, len(l)):
        j = p[i - 1]
        while j > 0 and l[i] != l[j]:
            j = p[j - 1]
        p[i] = j + int(l[i] == l[j])

    return rev[:len(s) - p[len(l) - 1]] + s


def shortestPalindrome2(self, s):
    if not s or len(s) == 1:
        return s

    s1 = '#'.join(list(s))
    s1 = '#' + s1 + '#'

    n = len(s1)
    f = [0] * n
    mid = right = pos = 0
    l = 1
    for i in range(1, n):
        if right > i:
            f[i] = min(f[2 * mid - i], right - i)
        else:
            f[i] = 0

        while i - f[i] - 1 >= 0 and i + f[i] + 1 < n and s1[i - f[i] - 1] == s1[i + f[i] + 1]:
            f[i] += 1

        if l < f[i]:
            l = f[i]
            pos = (i - f[i]) / 2
        
        if right < i + f[i]:
            mid = i
            right = i + f[i]

    idx = n / 2
    while idx >= 0:
        if idx - f[idx] == 0:
            l = f[idx]
            res = s1
            while idx + l < len(s1):
                res = s1[idx + l] + res
                l += 1
            return res.replace('#', '')
        idx -= 1


